import Footer from '../footer/footer';
import './home.css'
import SliderShow from './SliderShow';
import Menu from '../menu/menu';


function Home({setCart},){
    return(
        <div>
            <SliderShow/>

            <Menu setCart={setCart}/>

            <Footer />
    </div>
    )
}

export default Home;
